import React, { Component} from 'react';
import {withStyles} from '@material-ui/core/styles';
import PropTypes from "prop-types";
import Test from '../lib/Test';

const styles = theme => ({
    content: {
        flex: '1 0 auto',
        paddingTop: '5rem',
    }
});

function Details(props) {
    const {state,msg} = props;
    console.log("Message:",msg);
    return msg;
}

/**
 * The entire app get generated from this container.
 * We set the material UI theme by choosing a primary and secondary color from the metMuiThemes file
 * and creating a color palette with the createTheme method.
 * For information about using the different palettes see material UI documentation
 * 
 * This app contains the database, path and matrix states...
 */
class Status extends Component {
    constructor(props) {
	super(props);
	this.state="";
	props.state.React.Status = this;
    };
    // set dataset age
    setAge(state,age) {
	console.log("Age...",state.Database.mod,age);
	this.forceUpdate();
    };
    setLog(state,msg) {
	console.log("Updated...",msg);
	this.state=msg;
	this.forceUpdate();
    };
    progressInfo(state,e) {
	console.log("progress...");
	this.state="progress";
	this.forceUpdate();
    };
    loadInfo(state,e) {
	console.log("load...");
	this.state="loading";
	this.forceUpdate();
    };
    setInfo(state,msg) {
	console.log("set...",msg);
	this.state=msg;
	this.forceUpdate();
    };
    errorInfo(state,e) {
	console.log("error...");
	this.state="Error";
	this.forceUpdate();
    };
    abortInfo(state,e) {
	console.log("abort...");
	this.state="Abort";
	this.forceUpdate();
    };

    render() {
        const { classes, state } = this.props;
        return (
                <div className={classes.content}>
		   <Details state={state} msg={this.state}/>
                </div>
        );
    }
}

Status.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Status);
